import React from 'react';
import "./Aside_News.scss"
import NewsOld from './News_Old/NewsOld';
import NewsOldContainer from './News_Old/NewsOldContainer';


const AsideNews=(props)=>{
    return(
        <div className="Aside_News">
        <NewsOldContainer NewsData={props.NewsPage.NewsData} dispatch={props.dispatch} newPostText={props.NewsPage.newPostText}>
         </NewsOldContainer>
        </div>
    )
}

export default AsideNews
